import React from 'react';
import { ThemeProvider } from 'emotion-theming'
import Button from '../components/Button'
import SomeText from '../components/SomeText'
import theme from '../theme'

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Button />
      <SomeText />
    </ThemeProvider>
  );
}

export default App;
